import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ListItemsService {

  constructor() { }

  getList(): {} {
    const data = {
      carro: "preto"
    };

    return data;
  }

  updateItem() {
    console.log("teste da função update no serviço");
  }
}
